import React, { Component } from "react";

class Title extends Component {
  constructor() {
    super();
    this.bandera=true;
    this.objeto = [
      {
        id: 1,
        nombre: "Carlos",
        apellido: "Rivera",
      },

      {
        id: 2,
        nombre: "Ariel",
        apellido: "Gaitan",
      },

      {
        id: 3,
        nombre: "Kendall",
        apellido: "Ocampo",
      },
    ];
  }
  render() {
    return (
      this.bandera?<p>LOGIN</p>:<p>LOGOUT</p>
    );
  }
}

export default Title;
